import React from 'react'
import {useNavigate} from 'react-router-dom';
const About = () => {
  return (
    <div className='about'>
       <h2>
        About Page
      </h2>

      <button 
      onClick={()=> navigate('/')}
      className='btn_css'>
        Go About
      </button>
    </div>
  )
}

export default About
